import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { FaArrowLeft, FaArrowRight } from "react-icons/fa";
import './Login.css';

// Login Component
const Login = () => {
  const navigate = useNavigate();
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  const handleLogin = (e) => {
    e.preventDefault(); // Prevent page reload
    console.log("Login clicked");
    navigate("/movies");
  };

  return (
    <div
      className="login-container"
      style={{ backgroundImage: 'url("/loginbg.avif")' }}
    >
      <div className="login-card">
        <div className="back-arrow" onClick={() => navigate("/home")}>
          <FaArrowLeft />
        </div>
        <div className="forward-arrow" onClick={() => navigate("/register")}>
          <FaArrowRight />
        </div>

        <h2>Login</h2>
        <form onSubmit={handleLogin}>
          <input
            type="text"
            placeholder="Username"
            required
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            autoComplete="username"
          />
          <input
            type="password"
            placeholder="Password"
            required
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            autoComplete="current-password"
          />
          <button type="submit">Login</button>
        </form>

        <p>
          Don't have an account?{" "}
          <span
            onClick={() => navigate("/register")}
            style={{ color: "blue", cursor: "pointer" }}
          >
            Register
          </span>
        </p>
      </div>
    </div>
  );
};

// Home Component
const Home = () => {
  const navigate = useNavigate();

  return (
    <div
      className="home-container"
      style={{ backgroundImage: 'url("homebg.avif")' }} // cSpell:ignore homebg
    >
      <div className="home-card">
        <div className="back-arrow" onClick={() => navigate("/movies")}>
          <FaArrowLeft />
        </div>
        <div className="forward-arrow" onClick={() => navigate("/login")}>
          <FaArrowRight />
        </div>

        <h2>Welcome to Home</h2>
        <p>Enjoy browsing movies!</p>
      </div>
    </div>
  );
};

// MovieList Component
const MovieList = () => {
  const navigate = useNavigate();

  return (
    <div
      className="movie-list-container"
      style={{ backgroundImage: 'url("movielistbg.avif")' }} // cSpell:ignore movielistbg
    >
      <div className="movie-list-card">
        <div className="back-arrow" onClick={() => navigate("/home")}>
          <FaArrowLeft />
        </div>
        <div className="forward-arrow" onClick={() => navigate("/movies")}>
          <FaArrowRight />
        </div>

        <h2>Movie List</h2>
        <p>Browse your favorite movies here!</p>
      </div>
    </div>
  );
};

// Main App Component
const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/home" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/movies" element={<MovieList />} />
      </Routes>
    </Router>
  );
};

export default App;
